import React, {useState,useEffect} from 'react';
import {Container,Card, CardContent, Typography, Grid, CardMedia} from '@material-ui/core';
import Spinner from '../../components/spinner/spinner.component';
import {getOptionalAnimal} from '../../api/api';
import styles from './cats-page.module.css';

const CatsPage = () => {
    const [cats, setCats]  = useState([])
    useEffect(() => {
        const getAnimals = async () => {
            let animals = await getOptionalAnimal("Cat")
            setCats(animals.data.animals) 
        }

        getAnimals()
    })
    console.log(cats)
    return (
        <div className={styles.catsPage}>
            <Container maxWidth='lg'>
                <Grid container direction='row' justify='center' className={styles.gridContainer}>

                </Grid>
            </Container>
        </div> 
    )
}

export default CatsPage;
